•
When I was pregnant with my daughter, I was inspired by some striped storage bins I spotted in the Pottery Barn Kids catalog. I ripped out the page and started to plan how I could incorporate those same stripes into her room.
•
I came up with this design, a variation on those storage bins, because I knew the room could grow with her. We’ve done baby, toddler, elementary schooler and now in her last year of middle school, we are due for one more refresh. 
•
Two things will stay, the stripes and the bed...which has been in my family for FIVE generations!  I love these transitions of parenting...new milestones, new experiences...do they bring you joy or tears?
•
Swipe ↔️ to see the inspiration page from that catalog (yes I still have it after 13 years!) and tell me if you used to save your ideas the same way I did...pre-Pinterest!📌
